COPY public.objetivosestrategico (idobjetivosestrategico, nome, descricao, idplanestrategico) FROM stdin;
2	A - Garantir a excelência acadêmica	Inovar nos processos de aprendizagem em todas as esferas da universidade desde o início do processo de formação intelectual, com a educação básica, passando pelos cursos de graduação e pós graduação.	1
3	B - Assegurar a democratização do ensino	A nova universidade pública deverá reivindicar seu protagonismo como espaço de formação de pessoas conscientes por meio da conquista de legitimidade que, em um ambiente democrático, se afirma pelo acesso não classista, não racista, não sexista e não etnocêntrico aos cursos de graduação. Por isso, faz-se necessário avançar no que respeita à consolidação das políticas de ação afirmativa e na criação das condições materiais e simbólicas para o\r\nacolhimento, permanência, promoção e aprendizagem.	1
4	C - Promover qualidade de vida	Qualidade de vida, cada vez mais, se mostra um conceito fundamental, base para cuidarmos do ser humano como indivíduo e para cuidarmos de nossa instituição e da sociedade como um todo. Quem vive bem, com qualidade, multiplica bem-estar, trabalho e realizações.Para alcançarmos patamares de excelência uma Universidade deve ser constituída por pessoas comprometidas, integradas, motivadas e voltadas para a produção de conhecimentos de ponta, a transmissão de saberes consolidados e novos saberes.	1
5	D - Otimizar processos organizacionais e infraestrutura	A construção de diversos prédios destinados a abrigar unidades, laboratórios de pesquisa, espaços de ensino, além do novo Hospital Universitário e do campus de Governador Valadares são fundamentais para o alcance da excelência acadêmica, ao mesmo tempo em que exigem a adoção de padrões avançados de utilização e conservação de seu patrimônio.	1
7	E - Fortalecer a inovação social, a inserção e o desenvolvimento regional	A Universidade, ao exercer seu papel de responsabilidade social, se torna protagonista do diálogo entre os saberes e a sociedade. UFJF fortalecerá os projetos de extensão que, integrados ao ensino e à pesquisa, visem ao estudo e à transformação das dinâmicas socioeconômicas e ambientais em especial das mesorregiões da Zona da Mata e do Vale do Rio Doce, se expandindo para outras regiões nacionais, sobretudo pelo desenvolvimento da extensão no EAD, tendo sempre em vista uma sociedade mais justa.	1
8	F - Consolidar o desenvolvimento do Campus de Governador Valadares	A UFJF abraçou o Campus de Governador Valadares porque estava ciente da importância desse investimento para a região do Vale do Rio Doce. Todos os esforços serão feitos para implantar uma infraestrutura de excelência.	1
