5530	2018-01-11	09:23:56	Controler: item; action: cadastro; idconta: 16; idsubconta: 448; nome: Serviço de sonorização; numcomprasnet: ; idunidade: 40; prestacaoservico: 0; valor: R$ 4000.00; descricao: Prestação de serviço de estrutura de som para playback ,que atenda a um público de até 500 pessoas e que contenha computador com entrada para pendrive, caixa de som, caixa de retorno e equalisador. A estrutura deve conter ainda 2 microfones sem fio, 8 microfones condenser, mesa de som que atenda à estrutura de som citada e o serviço de um sonoplasta.; justificativa: Gerido pelo setor de Comunicação, Cultura e Eventos, o Coral Universitário se apresenta como um importante projeto cultural da UFJF GV. Em funcionamento desde maio de 2015, o projeto integra comunidade acadêmica e comunidade valadarense, propiciando aos participantes um espaço de aprendizagem e troca de experiências, contribuindo assim na efetivação do PDI e da missão da UFJF. O projeto também oportuniza uma maior visibilidade dos trabalhos do campus avançado e fomenta a formação de público, no campo da arte e da cultura, entre os estudantes e servidores. Os ensaios semanais são direcionados pela estudante do Curso de Administração, Zilmar Eller, que é bolsista de Treinamento Profissional. Os encontros acontecem em espaço cedido pelo GV Shopping, parceiro do projeto, já que a UFJF GV não tem ainda estrutura própria para atendimento à demanda. Para a efetivação das apresentações, que representam o marco final de cada etapa de produção do projeto, é fundamental que o grupo conte com a prestação de serviço da estrutura de som solicitada. Em 2018 a proposta que é o grupo se apresente quatro vezes, sendo duas no primeiro semestre e duas no segundo semestre.; MAX_FILE_SIZE: 2097152; submit: Confirmar; 	32	23	68	1	11	\N
