5719	2018-01-12	10:33:55	Controler: item; action: alterar; idconta: 11; idsubconta: 222; nome: Instalação de cortinado para fundo de palco; numcomprasnet: ; idunidade: 40; prestacaoservico: 1; descricao: Prestação de serviço de cortinado branco para fundo de palco - 12 metros de largura x 5 metros de altura; justificativa: Gerido pelo setor de Comunicação, Cultura e Eventos, o Coral Universitário se apresenta como um importante projeto cultural da UFJF GV. Em funcionamento desde maio de 2015, o projeto integra comunidade acadêmica e comunidade valadarense, propiciando aos participantes um espaço de aprendizagem e troca de experiências, contribuindo assim na efetivação do PDI e da missão da UFJF. O projeto também oportuniza uma maior visibilidade dos trabalhos do campus avançado e fomenta a formação de público, no campo da arte e da cultura, entre os estudantes e servidores. Os ensaios semanais são direcionados pela estudante do Curso de Administração, Zilmar Eller, que é bolsista de Treinamento Profissional. Os encontros acontecem em espaço cedido pelo GV Shopping, parceiro do projeto. Além disso, as apresentações do grupo acontecem em espaços cedidos por parceiros, uma vez que a UFJF GV não tem ainda estrutura própria. Sendo assim, os espaços cedidos precisam da inserção de um cortinado, que torne o palco adequado para as apresentações do Coral. Em 2018 a proposta que é o grupo se apresente quatro vezes, sendo que em duas dessas apresentações necessitaremos dos serviços de cortinado.; ativo: 1; submit: Alterar; 	19	23	104	1	\N	\N
